        static (Dictionary<Guid,Dog>, DogShortInfo[]) ParseTheDogApi()
        {
            var asList = new List<string>();
            var count = 0;
            var mem = 0;
            var separators = new[] { '\r', '\n', ' ', ',' };
            for (int i = 0; i < dogApiJson.Length; i++)
            {
                if (dogApiJson[i] == '{')
                {
                    if (count == 0)
                        mem = i;
                    count++;
                }
                if (dogApiJson[i] == '}')
                    count--;
                if (count == 0 && !separators.Contains(dogApiJson[i]))
                {
                    asList.Add(dogApiJson[mem..(i + 1)]);
                    i++;
                }
            }

            var dogs = asList.Select(x =>
            {
                /**/
                var weightSpan = ReadParameter(x, 0, "\"metric\":", out int afterPos);
                var wSpanInts = weightSpan.Split('-').Select(y => int.Parse(y)).ToArray();


                var heightSpan = ReadParameter(x, afterPos, "\"metric\":", out afterPos);
                var hSpanInts = heightSpan.Split('-').Select(y => int.Parse(y)).ToArray();

                var familyName = ReadParameter(x, afterPos, "\"name\":", out afterPos);
                var bredFor = ReadParameter(x, afterPos, "\"bred_for\":", out afterPos);
                var breedGroup = ReadParameter(x, afterPos, "\"breed_group\":", out afterPos);

                var lifeSpan = ReadParameter(x, afterPos, "\"life_span\":", out afterPos);
                var lSpanInts = lifeSpan.Remove(lifeSpan.IndexOf(" years"), 6).Split(new[] { '-', '–' }).Select(y => int.Parse(y)).ToArray();

                var temperament = ReadParameter(x, afterPos, "\"temperament\":", out afterPos);
                var url = ReadParameter(x, afterPos, "\"url\":", out afterPos); ;
                return new Dog(
                    url,
                    $"Family {familyName} bred for {bredFor} and relied to breed group {breedGroup}." +
                    $" Normally weight lies in {weightSpan} kg borders, height is {heightSpan} and life time near {lifeSpan}." +
                    $" The temperament of this family is {temperament}",
                    $"Family {familyName} relies to bred for group {bredFor} and relied to breed group {breedGroup}.",
                    new Family(familyName, hSpanInts[0], hSpanInts[hSpanInts.Length == 1 ? 0 : 1], wSpanInts[0], wSpanInts[wSpanInts.Length == 1 ? 0 : 1], lSpanInts[0], lSpanInts[lSpanInts.Length == 1 ? 0 : 1])
                    );
            }).ToArray();

            return (dogs.ToDictionary(x=>x.Id), dogs.Select(x => new DogShortInfo(x.Id, x.Family.Name, x.ImgUrl)).ToArray());

            string ReadParameter(string line, int from, string name, out int afterPos)
            {
                var readerBefore = from;
                var readerAfter = from;
                readerBefore = line.IndexOf(name, from) + name.Length + 2;
                afterPos = line.IndexOf("\"", readerBefore);
                return line[readerBefore..afterPos];
            }
        }

        public static readonly (Dictionary<Guid,Dog>, DogShortInfo[]) DogsInfo = ParseTheDogApi();
    }
